import React from "react";
import classes from './PrioritySettings.module.css';

const PrioritySettings = props =>{

    return (
        <div className={classes['priority-settings-div']}>
            <div className={classes['priority-settings-heading']}></div>
            <div className={classes['priority-settings-options']}></div>
            <div className={classes['priority-settings-desc']}></div>
        </div>
    );
}

export default PrioritySettings;
